import ExamCard from './ExamCard'
import axios from 'axios'
import {Link} from 'react-router-dom'


const ListExams = () => {

    const api = "http://localhost:8088/api/v1/examResult/trainee/{traineeId}"
    const [examList, setExamList] = useState([])

    useEffect(() => {
        loadExams()
    }, [])

    const loadExams = () => {
        axios.get(api)
                .then(response => {setExamList(response.data)})
                .catch(error => console.log('unable to load data'))
    }

    return(
        <div>
            {
                examList.map(
                    exam => <ExamCard key={exam.id} exam={exam}/>
                )
            }
           
        </div>
    )
}

